import React from 'react';
import { shapes } from '../Data/Shapes';
import { useNavigate } from 'react-router-dom';
import { useDispatch } from 'react-redux';
import { setSelectedShape } from '../Redux/actions'; // Assuming you have this action

function ShapeTerms() {
    const navigate = useNavigate();

    function handleShapeClick(shape) {
        localStorage.setItem('selectedShape', shape);
        navigate('/traditional-search');
        dispatch(setSelectedShape(shape));
    }

    return (
        <div>
            <h1>Shape Terms</h1>
            {shapes.map((shape, index) => (
                <p key={index} onClick={() => handleShapeClick(shape)}>
                    {shape}
                </p>
            ))}
        </div>
    );
}

export default ShapeTerms;
